8 cities. 20 dancers. 6 buses. This summer, American Ballet Theatre (@abtofficial) hit the road for a tour of truly epic proportions. In a triumphant return to live performance, ABT Across America saw the New York–based company perform outdoors for socially distanced audiences in Lincoln, Nebraska; Iowa City, Iowa; Chicago, Illinois; Minneapolis, Minnesota; St. Louis, Missouri; Charleston, South Carolina; Middleburg, Virginia; and New York, New York.

Dancers: @devon.teusch, @tylerrrmaloney, @laurenbonfiglio, @jacobclerico, @carlosgonzalezolivo, @kielyabg, 
@sungwoo_han_, @mikey_delanuez, @catehurlin, @anabel_katsnelson,
